import React from 'react'
import { Button,StyleSheet, Text, View } from 'react-native';

function Events({ navigation }) {
  return (
    <View>
        <Text>
            This is Events page
        </Text>
      <Button title="News" onPress={() => navigation.navigate("NewsDetail")} />
    </View>
  )
}

export default Events
